import "../css/Product.css";
import BestProducts from "./BestProduct.js";
import BasicProducts from "./BasicProducts.js";
import Pagination from "./Pagination.js";

function Product() {
  return (
    <div className="product-area">
      <BestProducts />
      <BasicProducts />
      <Pagination />
    </div>
  );
}

export default Product;
